import brandlogo from './brand.svg';
import {
  FormControl,
  Button,
  FormGroup,
  Navbar,
  NavItem,
  Container,
  Image,
  ButtonGroup,
  Nav,
  Form,
} from "react-bootstrap";
import * as FaIcons from 'react-icons/fa';

import 'bootstrap/dist/css/bootstrap.css';
//import classes from "./NavigBar.module.css";
import './NavigBar.css'
function NavigBar() {
  return (
    <div>
       <Navbar bg='light'>

           <Nav >
             <FaIcons.FaBars/>
         </Nav>
         <Nav id='space'>
             <Navbar.Brand>
           <  img width="146px" height="24px" className="img-responsive" src={brandlogo}  alt="logo" />
             </Navbar.Brand>
         </Nav>
         <Nav>
             <ButtonGroup>
                 <Button>Delivery</Button>
                 <Button>PickUP</Button>
             </ButtonGroup>
         </Nav>






       </Navbar>
    </div>
  );
}
export default NavigBar;
